// src/components/KakaoMap.jsx
import { useEffect } from "react";

export default function KakaoMap() {
  useEffect(() => {
    const script = document.createElement("script");
    script.onload = () => {
      window.kakao.maps.load(() => {
        const container = document.getElementById("map");
        const options = {
          center: new window.kakao.maps.LatLng(37.5665, 126.9780),
          level: 3,
        };
        const map = new window.kakao.maps.Map(container, options);

        const marker = new window.kakao.maps.Marker({
          position: new window.kakao.maps.LatLng(37.5665, 126.9780),
        });
        marker.setMap(map);
      });
    };
    script.src = "//dapi.kakao.com/v2/maps/sdk.js?appkey=2380b0c6e08137415b69715b13439001&autoload=false&libraries=services";
    document.head.appendChild(script);
  }, []);

  return (
    <div id="map" style={{ width: "100%", height: "200px", borderRadius: "12px" }}></div>
  );
}
